INSERT INTO `ow_project_description` VALUES ('tsrr','Trustie Software Resource Repository aims to provide a trustworthy software resource management mechanism and a software resources sharing environment. This project is hosted on the Trustie forge, operated by the OW2 China Local Chapter.',345,'2012-11-01 18:51:31');
INSERT INTO `ow_project_description` VALUES ('wcms','This project has not yet submitted a description.',345,'2012-11-01 18:51:31');
INSERT INTO `ow_project_description` VALUES ('wildcat','WildCAT is a Java toolkit/framework to make applications context-aware. It provides a simple and dynamic data model to represent the execution context of the application, which can be accessed both synchronously and asynchronously (pull and push).',345,'2012-11-01 18:51:31');
INSERT INTO `ow_project_description` VALUES ('wsunit','WSUnit is a tool that can help you test Web Services. It provides a predictable and repeatable simulation of a Web Service that is ideal for unit testing.',345,'2012-11-01 18:51:31');
INSERT INTO `ow_project_description` VALUES ('xlcloud','Focused on high-performance computing, the XLcloud collaborative project sets out to define and demonstrate a cloud platform based on HPC-as-a-Service.',345,'2012-11-01 18:51:31');
INSERT INTO `ow_project_description` VALUES ('xplus','xPlus is a implementation of the persistence provider of Enterprise Java Beans 3.0, also known as the Java Persistence API (JPA). It can be used as a stand-alone POJO persistence layer, or it can be integrated into any EJB3.0 compliant container.',345,'2012-11-01 18:51:31');
INSERT INTO `ow_project_description` VALUES ('xquare','The XQuare project provides a set of Java components for extending J2EE platforms with XML-based, heterogeneous information integration capabilities, using the XQuery language',345,'2012-11-01 18:51:31');
INSERT INTO `ow_project_description` VALUES ('xservice','XService suite, which is powered by ACT (The Institute of Advanced Computing Technology), Beihang University, Beijing, China, is a suite focus on web services and SOA, and provide fundamental element to enable service oriented computing(SOC).',345,'2012-11-01 18:51:31');
INSERT INTO `ow_project_description` VALUES ('xwiki','XWiki is a second-generation wiki. See http://xwiki.org for all details.',345,'2012-11-01 18:51:31');
INSERT INTO `ow_project_description` VALUES ('zeus','Open source Java-to-XML Data Binding tool.',345,'2012-11-01 18:51:31');
